var app=angular.module("h5_angularjs",["ngRoute"]);app.config(["$routeProvider",function(e){e.when("/",{templateUrl:"view/homepage.html",controller:"homepage"}).when("/next",{templateUrl:"view/next.html",controller:"next"}).when("/form",{templateUrl:"view/form.html",controller:"form"}).when("/day/:id",{templateUrl:"view/day.html",controller:"DayCtrl"}).otherwise({redirectTo:"/"})}]);
app.controller("form",["$scope",function(o){o.form={firstName:"form"}}]);
app.controller("homepage",["$scope",function(o){o.person={firstName:"John",lastName:"Doe"},console.log("fuck")}]);
app.controller("next",["$scope",function(e){e.next={firstName:"next"}}]);